  \"u-s-virgin-islands-national-park-coral-transplant-study-st-john-1999-2009-nodc-accession-011272\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In a pilot project in the Caribbean (Virgin
  Islands National Park, St. John, U.S. Virgin Islands), storm-produced fragments
  of Acropora palmata, Acropora cervicornis, and Porites porites were collected from
  donor reefs and transplanted to nearby degraded reefs. Sixty coral fragments were
  attached to dead-coral substrate (usually upright Acropora palmata skeletons), at
  similar depths from which they had been collected (1 to 3.5 m), using nylon cable
  ties. Seventy-five intact colonies were designated as reference colonies. Study
  colonies were assessed at 6-month intervals for 2 years (1999-2001) and annually
  thereafter (through 2009). The primary research objective was to evaluate the feasibility
  of using storm-produced coral fragments as the source of coral transplants to enhance
  degraded reefs.nnOriginal data are in MS-Excel spreadsheet format with a species
  list in .doc format and Federal Geographic Data Committee format (FGDC) metadata
  as an .xml file.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
